void mainImage( out vec4 fragColor, in vec2 fragCoord ) {
    vec2 uv = (2.0 * fragCoord - iResolution.xy) / iResolution.y;
    float d = length(uv);
    d = pow(d,2.);
    d = sqrt(sin(sqrt(9.*9.-d*d)+mod(sin(d*uv.x)/sin(uv.y*uv.x),iTime)));

    fragColor = vec4((fract(d/length(uv))*0.5)+mod(d,-uv.x),mod(d,uv.x), d*uv.y, 1.0);
}
